import styles from "./styles.module.css";
import React, { useState, useEffect } from "react";
import DriverBall from "../objects/DriverBall";

function Driver(numberDrivers) {
  const driverballs = [];
  for (let i = 0; i < numDrivers; i++) {
    balls.push(<DriverBall key={`driverBall-${i}`} />);
  }
  balls.push(<DriverBall key="driverBall" />);
  return <div>{balls}</div>;
  return (
    <div>
      <DriverBall />
    </div>
  );
}
export default Driver;
